import { apiHost } from 'config';
import React, { useState } from 'react';
import SockJsClient from 'react-stomp';

const WS = () => {

    return (
        <div>
            <SockJsClient 
                url={`${apiHost}/ws`} 
                topics={['/topics/party-updates']}
                onMessage={console.log}
                ref={client => this.clientRef = client} />
        </div>
    );
}

export default WS;
